import React from 'react';
import styled from 'styled-components';
import { useState , useEffect } from 'react';
import bgImage from './fondo_login.jpg';

const Container = styled.div`
    display: flex;
    height: 100vh;
    width: 100vw;
    position: relative;
    background-image: url(${bgImage});
    background-size: cover;
    background-position: center;
`;

const BlurOverlay = styled.div`
    position: absolute;
    top: 0;
    right: 0;
    width: 70%;
    height: 100%;
    background: rgba(103, 21, 125, 0.4); /* Añadida la transparencia del 20% */
    backdrop-filter: blur(15px);
`;

const Content = styled.div`
    display: flex;
    flex-direction: column;
    justify-content: flex-start; /* Cambiado de center a flex-start */
    align-items: center; /* Alinea al centro horizontalmente */
    color: white;
    padding: 20px;
    position: relative;
    z-index: 1;
    width: 70%; /* Ancho del contenido */
    margin-left: auto;
    height: 100%; /* Asegura que el contenedor ocupe toda la altura */
`;

const FormContainer = styled.div`
    width: 90%; /* Ajuste el ancho del formulario a un 90% del contenedor */
    max-width: 600px; /* Máximo ancho del formulario para pantallas grandes */
    height: 70vh; /* Altura fija del contenedor */
    background: rgba(255, 255, 255, 0.9);
    padding: 20px;
    border-radius: 10px;
    box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.1);
    overflow-y: auto; /* Habilita el desplazamiento vertical */
    color: black; /* Texto en color negro */
    /* Estilos responsivos */
    @media (max-width: 768px) {
        width: 95%;
    }
    @media (max-width: 480px) {
        width: 100%;
        padding: 10px;
    }
`;

const Label = styled.label`
    font-family: 'Hint Vadodara', sans-serif;
    margin-bottom: 5px;
    display: block;
`;

const Input = styled.input`
    padding: 10px;
    border: 1px solid #ccc;
    border-radius: 5px;
    font-family: 'Hint Vadodara', sans-serif;
    background-color: #f9f9f9; /* Color de fondo */
    width: 100%;
    margin-bottom: 15px;
`;

const Logo = styled.img`
    width: 200px; /* Ajusta el ancho según sea necesario */
    height: auto; /* Mantén la proporción de la imagen */
    margin-bottom: 20px;
`;

const Description = styled.p`
    font-size: 1.5rem;
    text-align: center; /* Alinea al centro horizontalmente */
    margin-bottom: 20px;
    font-family: 'Hint Vadodara', sans-serif;
`;

const Button = styled.button`
    width: 150px;
    height: 50px;
    padding: 0px 15px;
    display: flex;
    justify-content: center;
    align-items: center;
    border-radius: 50px; /* Cambiado de 23px a 50px */
    border: none; /* Eliminado el borde */
    background: #213B6B; /* Cambiado el fondo */
    box-shadow: 0px 4px 8px rgba(101, 91, 127, 0.3); /* Añadido el box-shadow */
    color: white; /* Color del texto */
    font-family: 'Hint Vadodara', sans-serif;
    font-size: 20px; /* Cambiado el tamaño de fuente */
    font-weight: 400; /* Cambiado el peso de la fuente */
    line-height: normal;
    cursor: pointer;
    word-wrap: break-word; /* Añadido word-wrap */
    margin: 10px; /* Añadido el margen */
`;

const FormEmprendedor = ({ navigate }) => {
    const [formData, setFormData] = useState({
        nombreEmprendedor: '',
        nacionalidad: '',
        ciudadResidencia: '',
        documentoIdentidad: '',
        correoPersonal: '',
        correoInstitucional: '',
        telefono: ''
    });

    const handleChange = (e) => {
        const { id, value } = e.target;
        setFormData((prevData) => ({
            ...prevData,
            [id]: value
        }));
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log(formData);
        // Aquí puedes manejar el envío de los datos
    };

    const handleBack = () => {
        navigate('home');
    };

    return (
        <div>
            <Container>
                <BlurOverlay />
                <Content>
                    <Logo src="logo.png" alt="Logo" />
                    <Description>Formulario de registro para emprendedores</Description>
                    <FormContainer>
                        <form onSubmit={handleSubmit}>
                            <Label htmlFor="nombreEmprendedor">Nombre del emprendedor:</Label>
                            <Input id="nombreEmprendedor" type="text" value={formData.nombreEmprendedor} onChange={handleChange} required />

                            <Label htmlFor="nacionalidad">Nacionalidad:</Label>
                            <Input id="nacionalidad" type="text" value={formData.nacionalidad} onChange={handleChange} required />

                            <Label htmlFor="ciudadResidencia">Ciudad de residencia:</Label>
                            <Input id="ciudadResidencia" type="text" value={formData.ciudadResidencia} onChange={handleChange} required />

                            <Label htmlFor="documentoIdentidad">Documento de identidad:</Label>
                            <Input id="documentoIdentidad" type="text" value={formData.documentoIdentidad} onChange={handleChange} required />

                            <Label htmlFor="correoPersonal">Correo electrónico personal:</Label>
                            <Input id="correoPersonal" type="email" value={formData.correoPersonal} onChange={handleChange} required />

                            <Label htmlFor="correoInstitucional">Correo electrónico institucional:</Label>
                            <Input id="correoInstitucional" type="email" value={formData.correoInstitucional} onChange={handleChange} required />

                            <Label htmlFor="telefono">Teléfono:</Label>
                            <Input id="telefono" type="text" value={formData.telefono} onChange={handleChange} required />

                            <Button type="submit">Terminado</Button>
                            <Button type="button" onClick={handleBack}>Regresar</Button>
                        </form>
                    </FormContainer>
                </Content>
            </Container>
        </div>
    );
};

export default FormEmprendedor;
